import React, { useState } from "react";
import { Helmet } from "react-helmet";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Stack from "@mui/material/Stack";
import Button, { ButtonProps } from "@mui/material/Button";
import FormGroup from "@mui/material/FormGroup";
import { styled } from "@mui/material/styles";
import { useNavigate } from "react-router-dom";
import axios, { HeadersDefaults } from "axios";
import converterIcon from "../assets/converter-icon.png";

const Convert = () => {
  const location = useLocation();
  let username = location.state;
  console.log(location.state);
  return (
    <>
      <Helmet>
        <title>{`Log In`}</title>
      </Helmet>
      <section className="c-convert">
        <div className="c-convert__card">
          <div className="c-convert__card__logo">
            <img src={converterIcon} alt="" className="o-logo" />
            <div className="c-convert__card__logo__text">
              <p>Currency</p>
              <p>Transfer</p>
            </div>
          </div>
          <FormGroup>
            <Box
              component="form"
              sx={{
                "& > :not(style)": { m: 1, width: "45ch" },
              }}
              noValidate
              autoComplete="off"
              className="c-login__card__form"
            ></Box>
          </FormGroup>
        </div>
      </section>
    </>
  );
};

export default Convert;
